import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './CustomPolicySearch.css';

function CustomPolicySearch() {
    const [selectedGroup, setSelectedGroup] = useState(null);
    const [selectedDetail, setSelectedDetail] = useState(null);
    const [selectedAge, setSelectedAge] = useState("20ÏÑ∏");
    const [selectedPolicy, setSelectedPolicy] = useState("Ï£ºÍ±∞ÏßÄÏõêÌòï");
    const navigate = useNavigate();

    const handleGroupSelect = (group) => {
        setSelectedGroup(group);
    };

    const handleDetailSelect = (detail) => {
        setSelectedDetail(detail);
    };

    const handleAgeChange = (event) => {
        setSelectedAge(event.target.value);
    };

    const handlePolicyChange = (event) => {
        setSelectedPolicy(event.target.value);
    };

    const handleSubmit = () => {
        navigate('/results', {
            state: {
                selectedGroup,
                selectedDetail,
                selectedAge,
            },
        });
    };

    return (
        <div className="custom-policy-container">
            <header className="custom-policy-header">
                <span className="time">9:41</span>
                <span className="title">ÎßûÏ∂§ Ï†ïÏ±ÖÏ∞æÍ∏∞</span>
                <span className="icons">
                    <span role="img" aria-label="battery">üîã</span>
                </span>
            </header>

            <div className="input-group">
                <label>ÎÇòÏù¥Î•º ÏïåÎ†§Ï£ºÏÑ∏Ïöî</label>
                <select onChange={handleAgeChange} value={selectedAge}>
                    <option>20ÏÑ∏</option>
                    <option>21ÏÑ∏</option>
                    <option>22ÏÑ∏</option>
                    <option>23ÏÑ∏</option>
                    <option>24ÏÑ∏</option>
                    <option>25ÏÑ∏</option>
                </select>
            </div>

            <div className="input-group">
                <label>ÏÜåÏÜçÎêòÏã† ÏßëÎã®Ïóê ÌëúÏãúÌï¥Ï£ºÏÑ∏Ïöî</label>
                <div className="radio-group">
                    {["Ï†ÑÎ¨∏ÎåÄÏÉù", "ÎåÄÌïôÏÉù", "Ï∑®Ï§ÄÏÉù", "ÏÇ¨ÌöåÏ¥àÎÖÑÏÉù", "Ï§ëÏÜåÍ∏∞ÏóÖÏû¨ÏßÅ", "Ï≤≠ÎÖÑÏ∞ΩÏóÖ", "Í≥†Ï°∏"
                    ,"Ï∞®ÏÉÅÏúÑÍ≥ÑÏ∏µ", "ÏûêÎ¶ΩÏ§ÄÎπÑÏ≤≠ÎÖÑ", "ÎåÄÌïôÏõêÏÉù"].map((group) => (
                        <div
                            key={group}
                            className={`radio-button ${selectedGroup === group ? "selected" : ""}`}
                            onClick={() => handleGroupSelect(group)}
                        >
                            {group}
                        </div>
                    ))}
                </div>
            </div>


            <div className="input-group">
                <label>Ï†ïÏ±Ö Ïπ¥ÌÖåÍ≥†Î¶¨Î•º ÏÑ§Ï†ïÌï¥Ï£ºÏÑ∏Ïöî</label>
                <select onChange={handlePolicyChange} value={selectedPolicy}>
                    <option>Ï£ºÍ±∞ÏßÄÏõêÌòï</option>
                    <option>Ï∞ΩÏóÖÏßÄÏõêÌòï</option>
                    <option>Í∏∞Î≥∏ÏÜåÎìùÌòï</option>
                </select>
            </div>


            <div className="input-group">
                <label>ÏÑ∏Î∂ÄÍ∏∞Îä•ÏùÑ ÌëúÏãúÌï¥Ï£ºÏÑ∏Ïöî</label>
                <div className="radio-group">
                    {["ÎßàÍ∞êÎêú Í≤ÉÎèÑ Î≥¥Ïó¨Ï£ºÏÑ∏Ïöî", "ÌïòÎÇòÏùò Í∏∞Îä•", "ÎëêÍ∞úÏùò Í∏∞Îä•", "ÏÑ∏Í∞úÏùò Í∏∞Îä•"].map((detail) => (
                        <div
                            key={detail}
                            className={`radio-button ${selectedDetail === detail ? "selected" : ""}`}
                            onClick={() => handleDetailSelect(detail)}
                        >
                            {detail}
                        </div>
                    ))}
                </div>
            </div>

            <button className="complete-button" onClick={handleSubmit}>ÏôÑÎ£å</button>
        </div>
    );
}

export default CustomPolicySearch;
